  WILLIAMS, Simon Henry and GIBB, Helen Mary (cont...)
  she was based in Sydney and nursed and travelled in various places including Japan, Taiwan and
  Hongkong. She returned to England in 1971 and worked as senior Sister in the Medical Ward at Dorset
  County Hospital until 1978. She started nursing again in 1985 at Port Bredy Hospital, Bridport.
  01> WILLIAMS, Alastair Henry
  b 17.07.1979
  02> WILLIAMS, Emma Ruth
  b 19.12.1980
  02> WILLIAMS, Robert Euan
  b 26.03.1944
  Euan b. at London. Address: 5 Arbutus Close, Dorchester, Dorset DT1 1PZ, England.
  Euan was educated at Summerfields Oxford (1952-57); Marlborough College (1957-61); Pestalozzi Schule,
  Unna, Westphalia; and Sussex University (1964-69) including University of Heidelberg (1966-68). He
  graduated. BA European Studies (German). He took a Post Graduate apprenticeship with Rolls Royce Bristol
  Engines Division, Coventry and was Export Contracts Engineer with special responsibility for Brown
  Boveri. He moved to Rolls Royce headquarters in London and was their marketing representative at the
  Royal Institute for International Affairs, Chatham House, London.
  He left Rolls Royce in 1974 to freelance in textile design. He designed and made his own yarns and
  machine-knitted fabrics. Later he designed specialist yarns for a small manufacturer in London. He took
  up desktop publishing in 1984 and is currently a designer, typesetter, photographer and author. He
  contributed a chapter on photography to his mother's "The Batsford Embroidery Course" as well as doing
  all the photographs.
  10> WILLIAMS, Sarah Catherine (Kitty) m on 02.12.1916 to TAPLIN, Joseph Hugh
  b 03.10.1876 d 06.02.1956
  b ** ** **** d ** ** 1951
  Sarah b. at Pakaraka and d. at Aurangi. She worked at Hornchurch Hospital, England in WW1. After
  her marriage Kitty returned to New Zealand and she and Tap farmed "Mokoiwi", an isolated
  property near Ruatoria. In the 1940's they bought "Mangarewarewa", a 450 acre property near
  "Matahiia". No children,
  11> WILLIAMS, Gerard Temple (Husky)
  b 12.01.1880 d 01.09.1915
  Gerard b, at Pakaraka. He was educated at Wanganui Collegiate School (1896). He joined Williams & Kettle in
  Napier and was a sheep farmer at "Mokoiwi" at Ruatoria. He served with the 3rd Reinforcements NZEF in wwi and
  fought at Gallipoli. He died of sickness at sea en route to Malta.
